  return (
    <div className="container">
      <LeftBox>
        <Logo />
      </LeftBox>
      <RightBox></RightBox>
    </div>
  );
}

function LeftBox() {
  return (
    <section className="left">
      <h1>Left side</h1>
    </section>
  );
}

function RightBox() {
  return (
    <section className="right">
      <h1>Right size</h1>
    </section>
  );
}

function Logo() {
  return (
    <div>
      <h1 className="logo">Logo name</h1>
    </div>
  );
}
